IF OBJECT_ID('dbo.proc_transform_152', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_152;
GO
CREATE PROCEDURE dbo.proc_transform_152
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_152
    SET payload = LEFT(payload, 1000) + N'|V4-152|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_152;
END
GO
IF OBJECT_ID('dbo.audit_v4_152', 'U') IS NULL
